import React from "react";
import { Sidebar, Menu, MenuItem, SubMenu } from "react-pro-sidebar";
import { useDispatch, useSelector } from "react-redux";
import { asyncTopic, asyncSub } from "../../../store/store";

export default function ExampleSide() {
  const dispatch = useDispatch();

  const topic_list = useSelector((state) => state.topicSlice.list);
  const sub_list = useSelector((state) => state.subSlice.list);
  useEffect(() => {
    dispatch(asyncTopic());
    dispatch(asyncSub());
  }, []);

  return (
    <div>
      <Sidebar>
        <Menu iconShape="square">
          <MenuItem>Dashboard</MenuItem>
          <MenuItem>Link</MenuItem>
          <SubMenu label="Components">
            <MenuItem>Component 1</MenuItem>
            <MenuItem>Component 2</MenuItem>
          </SubMenu>
        </Menu>
      </Sidebar>
    </div>
  );
}
